    n, m = map(int, stdin.split())
    seq = list(map(int, stdin.split()))


    def get_median(seq, start, end):
        return (seq[start] + seq[end]) / 2


    def is_median_equal_m(seq, m, start, end):
        if (len(seq) % 2) == 0:
            return (get_median(seq, start, end) == m)

        return (get_median(seq, start, end) > m)


    def binary_search(seq, m):
        start = 0
        end = len(seq) - 1

        while True:
            if is_median_equal_m(seq, m, start, end):
                return end - start

            mid = (start + end) // 2
            if is_median_equal_m(seq, m, start, mid):
                start = mid
            else:
                end = mid


    count = 0
    for i in range(n):
        for j in range(i + 1, n):
            count += binary_search(seq, m)

    return str(count)

