    for road in roads:
        if road[0] == road[1]:
            continue

        x = find_set(sets[road[0]])
        y = find_set(sets[road[1]])

        if x[0] == y[0]:
            continue

        union_sets(x, y)

    options = set()
    for i in range(k):
        sets = {}
        for j in range(1, n+1):
            sets[j] = make_set(j)

        for road in roads:
