def solution(stdin: str) -> str:
    """Finds the subset of vertices with the maximum total weight (the weight of the subset is the sum of weights of all vertices in it) such that there is no pair of vertices with the distance $k$ or less between them in this subset.

    >>> solution('5 1\n1 2 3 4 5\n1 2\n2 3\n3 4\n3 5\n')
    11
    """

    n, k = map(int, stdin.split())
    a = [int(n) for n in stdin.split()]
    graph = [[] for _ in range(n)]
    for u, v in zip(a[:-1:2], a[1::2]):
        graph[u - 1].append(v - 1)
        graph[v - 1].append(u - 1)
    w = [0] * n

    def dfs(u):
        if w[u] < 0:
            return
        for v in graph[u]:
            if w[v] >= 0:
                w[u] += w[v] + 1
                w[v] = -1
                dfs(v)

    m = 0
    for i in range(n):
        if w[i] >= 0:
            dfs(i)
            m = max(m, sum(w))
    return m

