def solution(stdin: str) -> str:
    n, k = map(int, stdin.split())

    dna = []
    for i in range(n):
        dna.append(stdin.split()[i])

    adjacency_list = {}
    for i in range(n-1):
        for j in range(i+1, n):
            for m in range(k):
                if dna[i][m]!= dna[j][m]:
                    if (i, j) in adjacency_list:
                        adjacency_list[(i, j)] += 1
                    else:
                        adjacency_list[(i, j)] = 1

    # for each edge (i, j), compute the likelihood of the edge
    likelihoods = {}
    for i, j in adjacency_list:
        likelihoods[(i, j)] = adjacency_list[(i, j)] / len(dna)

    # if there is an edge from i to j, likelihood is 0
    for i, j in adjacency_list:
        likelihoods[(i, j)] = 0
        likelihoods[(j, i)] = 0

    # compute the weight of each edge
    weights = {}
    for i, j in adjacency_list:
        weights[(i, j)] = sum(likelihoods.values())
        weights[(j, i)] = weights[(i, j)]

    # compute the weight of each tree
    trees = []
    for i in range(n-1):
        trees.append(sum(weights.values()))

    return min(trees)

