        if row < 1 or col < 1 or row > n or col > m:
            return False
        if grid[row][col] == '1':
            return False
        return True

    def can_exit(pos: List[int], direction: str) -> bool:
        '''
        Checks if Eren can move in the direction specified and then check if he
        is safe in the next position.
        '''
        row, col = pos
        if direction == 'U':
            return is_safe([row - 1, col])
        if direction == 'D':
            return is_safe([row + 1, col])
        if direction == 'L':
            return is_safe([row, col - 1])
        if direction == 'R':
            return is_safe([row, col + 1])
        return False

    # loop over each possible direction
    min_zones = 0
    for direction in ['U', 'D', 'L', 'R']:
        if can_exit([1, 1], direction):
            min_zones += 1
        # only one 'S' is available, so if it is not possible to escape, it
        # is not possible to escape from all directions
